	<script type="text/javascript">
		var defaultOpacity = .3;

		function decodeValue(value) {
			if (!value) {
				return '';
			}

			return value.replace(/VT4\(|\)$/g, '');
		}

		function encodeValue(value) {
			if (!value) {
				return '';
			}
			
			return 'VT4(' + value + ')';
		}

		function getVariable(variableName, field) {
			field = typeof field !== 'undefined' ? field : 'variable';
			return $('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="' + field + '"][v\\:val="' + encodeValue(variableName) + '"])');
		}

		function getProcess(processId) {
			return $('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="processId"][v\\:val="' + encodeValue(processId) + '"])');
		}

		function getProcesses(variableName, enabled) {
			// var variableFilter = '[v\\:val' + (filterOutputProcess ? '^="VT4(' : '*=",') + variableName + '"]';
			var variableFilter = '[v\\:val*="' + variableName + '"]';
			var enabledFilter = '';

			if (enabled != undefined) {
				enabledFilter = enabled ? ':not(.disabled)' : '.disabled';
			}

			return $('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="process"]' + variableFilter + '):not(.hidden)' + enabledFilter);
		}

		function toggleProcessesVisibility(variable, visible) {
			var toggleProcesses = decodeValue(variable.find('v\\:cp[v\\:lbl="toggleProcesses"]').attr('v:val')).split(',');

			if (toggleProcesses.length > 0) {
				for (var index in toggleProcesses) {
					var process = getProcess(toggleProcesses[index]);
					var variableNames = decodeValue(process.find('v\\:cp[v\\:lbl="process"]').attr('v:val')).split(',');

					if (visible) {
						process.removeClass('hidden');
					} else {
						process.addClass('hidden');
					}

					if (getVariable(variableNames[0]).hasClass('disabled') || getVariable(variableNames[1]).hasClass('disabled')) {
						process.css('opacity', defaultOpacity).addClass('disabled');
					} else {
						process.css('opacity', 1).removeClass('disabled');
					}
				}
			}

			var triggerAlternateName = decodeValue(variable.find('v\\:cp[v\\:lbl="triggerAlternateName"]').attr('v:val'));
			var alternateVariable = getVariable(triggerAlternateName);
			
			alternateVariable.addClass('hidden');
			
			if (visible) {
				var proxyVariableName = decodeValue(alternateVariable.find('v\\:cp[v\\:lbl="proxy"]').attr('v:val'));
				var proxyVariable = getVariable(proxyVariableName, 'proxyName');

				proxyVariable.attr('transform', alternateVariable.attr('transform'));
				proxyVariable.removeClass('hidden');
			} else {
				alternateVariable.has('v\\:cp[v\\:lbl="proxy"]').removeClass('hidden');
			}
		}

		function enableVariable(variableName) {
			var variable = getVariable(variableName);

			if (!variable.hasClass('disabled')) {
				return;
			}

			variable.css('opacity', 1).removeClass('disabled');
			
			if (typeof waterQualityDialog !== 'undefined') {
				waterQualityDialog.toggleItem(variableName, true);
			}

			toggleProcessesVisibility(variable, false);
			
			var processes = getProcesses(variableName);
			processes.each(function() {
				enableProcess($(this));
			});
		}

		function disableVariable(variableName) {
			var variable = getVariable(variableName);

			if (variable.hasClass('disabled')) {
				return;
			}

			if (variable.find('v\\:cp[v\\:lbl="blocked"]').length == 0) {
				variable.css('opacity', defaultOpacity).addClass('disabled');

				if (typeof waterQualityDialog !== 'undefined') {
					waterQualityDialog.toggleItem(variableName, false);
				}
			}

			var processes = getProcesses(variableName);

			processes.each(function() {
				if (!$(this).hasClass('disabled')) {
					disableProcess($(this));
				}
			});

			toggleProcessesVisibility(variable, true);
		}

		function toggleProcessSiblings(process, enable) {
			var siblings = process.find('v\\:cp[v\\:lbl="siblings"]');

			if (siblings.length > 0) {
				var siblingLabels = decodeValue(process.find('v\\:cp[v\\:lbl="siblings"]').attr('v:val')).split(',');

				for (var index in siblingLabels) {
					var sibling = getProcess(siblingLabels[index]);

					if (enable) {
						enableProcess(sibling);
					} else {
						disableProcess(sibling);
					}
				}
			} else {
				if (enable) {
					var processId = decodeValue(process.find('v\\:cp[v\\:lbl="processId"]').attr('v:val'));

					if (processId.length > 0) {
						var siblings = $('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="siblings"][v\\:val*="' + processId + '"])');

						siblings.each(function() {
							if ($(this).hasClass('disabled')) {
								enableProcess($(this));
							}
						});
					}
				}
			}
		}

		function enableProcess(process) {
			var variables = decodeValue(process.find('v\\:cp[v\\:lbl="process"]').attr('v:val')).split(',');

			process.css('opacity', 1).removeClass('disabled');

			toggleProcessSiblings(process, true);
			enableVariable(variables[0]);
			enableVariable(variables[1]);
		}

		function disableProcess(process) {
			process.css('opacity', defaultOpacity).addClass('disabled');

			var variables = decodeValue(process.find('v\\:cp[v\\:lbl="process"]').attr('v:val')).split(',');
			var fromHasProcessesEnabled = getProcesses(variables[0], true).length > 0;
			var toHasProcessesEnabled = getProcesses(variables[1], true).length > 0;

			toggleProcessSiblings(process, false);
			
			if (!fromHasProcessesEnabled) {
				disableVariable(variables[0]);
			}

			if (!toHasProcessesEnabled) {
				disableVariable(variables[1]);
			}
		}

		$(document).ready(function() {
			$('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="hidden"])').addClass('hidden');

			$('g:not([v\\:index="1"]):has(v\\:cp[v\\:lbl="process"])')
				.css('cursor', 'pointer')
				.hover(
					function() {
						$(this).css('text-decoration', 'underline');
					},
					function() {
						$(this).css('text-decoration', 'none');
					}
				)
				.on('click', function() {
					if ($(this).hasClass('disabled')) {
						enableProcess($(this));
					} else {
						disableProcess($(this));
					}
				});

			var blockedVariables = $('g:has(v\\:cp[v\\:lbl="blocked"])');
			blockedVariables.css('cursor', 'default');

			$('g:has(v\\:cp[v\\:lbl="variable"])')
				.not(blockedVariables)
				.css('cursor', 'pointer')
				.on('click', function() {
					var variableName = decodeValue($(this).find('v\\:cp[v\\:lbl="variable"]').attr('v:val'));

					if ($(this).hasClass('disabled')) {
						enableVariable(variableName);
					} else {
						disableVariable(variableName);
					}
				});
		});
	</script>
